import React from 'react';
import './Footer.css';

const quickLinks01 = [
    {
        path: '#',
        display: 'Marketing'
    },
    {
        path: '#',
        display: 'Analytics'
    },
    {
        path: '#',
        display: 'Commerse'
    },
]

const Footer = () => {
  return (
    <footer className="footer">
        <div className="container">
            <div className="footer_wrapper">
                <div className="footer_logo">
                    <h2>Digency</h2>
                    <p className="description">Grow with us</p>
                    <p className="small_text description">Lorem ipsum dolor sit, amet consectetur adipisicing elit. Ea corrupti nihil facere quas temporibus. Fugiat, incidunt? Vitae nisi temporibus quisquam.

                    </p>
                </div>
                <div className="footer_quick-links">
                    <div className="quick_links-title">Solution</div>
                    <ul className="quick_links"></ul>
                </div>
            </div>
        </div>
    </footer>

  );
};

export default Footer;
